import React from 'react';
import User from './User';

import './Users.css';


const Users = ({ users }) => {
    console.log(users);
    return ( 
        <>
            <table className='table-container'>
            <tr>
                <th>Nome</th>
                <th>Email</th>
            </tr>
            </table>
            {
                users.map((user) => (
                    <User user={user} />
            ))}
        </>
     );
}

export default Users;
